// SPDX-License-Identifier: MIT pragma solidity >=0.4.22 <0.9.0;
pragma solidity ^0.8.6;


contract Library  {
    address public owner;
    struct MyData {
        string username;
        uint256 creationDate;
        string country;
        string language;
        string[] records;
    }

    uint64 public nbUsers = 0;

    mapping(address => uint64) public userIds;
    // userId => UserType
    mapping(uint64 => MyData) private records;
    mapping(string => address) public usernames;

    constructor () {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }
    function isOwner() internal view returns(bool) {
        return owner == msg.sender;
    }

//
//    function _msgData() internal view  returns (bytes memory) {
//        this; // silence state mutability warning without generating bytecode - see https://github.com/ethereum/solidity/issues/2691
//        return msg.data;
//    }
//
//    function _msgValue() internal view  returns (uint256 value) {
//        return msg.value;
//    }

    function hasAccount() public view returns(bool has) {
        if (userIds[msg.sender] == 0) {
            return false;
        }
        return true;
    }

    struct PublicInfo {
        string username;
        uint256 creationTime;
        string country;
        string language;
    }

    function infos(string memory username) public view returns (PublicInfo memory info) {
        require(userIds[usernames[username]] >0, "username not registered");
        return PublicInfo(username, records[userIds[usernames[username]]].creationDate, records[userIds[usernames[username]]].country, records[userIds[usernames[username]]].language);
    }

    function myInfos() public view returns (PublicInfo memory info) {
        require (userIds[msg.sender] > 0, "user not registered");
        return PublicInfo(records[userIds[msg.sender]].username, records[userIds[msg.sender]].creationDate, records[userIds[msg.sender]].country, records[userIds[msg.sender]].language);
    }

    function register(string memory username, string memory country, string memory language, uint256  donation) public returns (uint64 id){
        require(userIds[usernames[username]] ==0, "username already registered");
        require (userIds[msg.sender] == 0, "user key already registered");
        if (userIds[msg.sender] == 0) {
            nbUsers = nbUsers+1;
            // not registered
            userIds[msg.sender] = nbUsers;
            records[nbUsers].username = username;
            records[nbUsers].creationDate = block.timestamp;
            records[nbUsers].country = country;
            records[nbUsers].language = language;
        }
        id= userIds[msg.sender];
        return id;
    }

    function addPatches( string memory data) public returns (bool  ok) {
        require(userIds[msg.sender] > 0, "must Be registered");
        uint64 id =  userIds[msg.sender];
        records[id].records.push(data);
        ok = true;
    }

    function loadUsernamePatches(string memory username) public view returns ( string[] memory myData) {
        require(userIds[usernames[username]] > 0, "This UserName doesn't exist");
        uint64 id = userIds[usernames[username]];
        return records[id].records;
    }

    function loadPatches() public view returns ( string[] memory myData) {
        require(userIds[msg.sender] > 0, "must Be registered");
        uint64 id =  userIds[msg.sender];
        return records[id].records;
    }

}
